    { description: "Go to work", deadline: "2021-11-10 09:00" },
    { description: "Go to sleep", deadline: "2021-11-10 22:00" }
  ]; */

  const todo = data.todos;

  return (
    <ul>
      {toDos.map((todo) => {
        return <ToDoListItem todo={todo} />;
      })}
    </ul>
  );
}
